# ------------
# collatz_read
# ------------

def collatz_read (s) :
    """
    read two ints
    s a string
    return a list of two ints, representing the beginning and end of a range, [i, j]
    """
    a = s.split()
    return [int(a[0]), int(a[1])]

# -------------
# collatz_cycle_length
# -------------

def collatz_cycle_length (n) :

    """
    n the value for which the cycle length is to be calculated
    temp holds n while operations are performed on n
    returns the cycle length of n
    """
    collatz_cycle_length = 1
    temp = n
    while n > 1 :

        if n in cache :
            return collatz_cycle_length + cache[n] - 1

        if n % 2 == 0 :
            n = n // 2
        else:
            n = n * 3 + 1
        collatz_cycle_length += 1


    cache[temp] = collatz_cycle_length

    return collatz_cycle_length

# ------------
# collatz_eval
# ------------

def collatz_eval (i, j) :
    """
    i the beginning of the range, inclusive
    j the end       of the range, inclusive
    return the max cycle length of the range [i, j]
    """

    if i > j :
        temp = i
        i = j
        j = temp

    assert i > 0
    assert j > 0
    assert i < 1000000
    assert j < 1000000
    assert i <= j

    max_collatz_cycle_length = 1

    while i <= j :
        current_collatz_cycle_length = collatz_cycle_length (i)
        if current_collatz_cycle_length > max_collatz_cycle_length :
            max_collatz_cycle_length = current_collatz_cycle_length
        i += 1

    assert max_collatz_cycle_length >= 1
    return max_collatz_cycle_length

# -------------
# collatz_print
# -------------

def collatz_print (w, i, j, v) :
    """
    print three ints
    w a writer
    i the beginning of the range, inclusive
    j the end       of the range, inclusive
    v the max cycle length
    """
    w.write(str(i) + " " + str(j) + " " + str(v) + "\n")

# -------------
# collatz_solve
# -------------

def collatz_solve (r, w) :
    """
    r a reader
    w a writer
    """

    for s in r :
        i, j = collatz_read(s)
        v    = collatz_eval(i, j)
        collatz_print(w, i, j, v)
